import json

import redis

image_data = '{"width":2268,"height":1512,"data":"data:image/jpeg;base64,"}'

R = redis.Redis(host='redis', port=6379, decode_responses=True)
pubsub = R.pubsub()

R.hset("Image", 1, image_data)

published_data = {
    'ID': 1,
    'type': 'image',
    'hashset': 'Image'
}

json_published_data = json.dumps(published_data, indent=4)

R.publish('/debug/percept', json_published_data)
